import React from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import LoginForm from './components/LoginForm';
import HomePage from './components/HomePage';
import NotFoundPage from './components/NotFoundPage';
import PrivateRoute from './components/PrivateRoute'; // Asegúrate de importar PrivateRoute
import { useSelector } from 'react-redux';
import { selectToken } from './features/auth/authSlice'; // Cambia selectAuth por selectToken

const App = () => {
  const token = useSelector(selectToken); // Usa selectToken en lugar de selectAuth

  return (
    <Router>
      <Switch>
        <Route path="/login">
          {!token ? <LoginForm /> : <Redirect to="/" />}
        </Route>
        <PrivateRoute path="/" exact component={HomePage} />
        <Route path="*">
          <NotFoundPage />
        </Route>
      </Switch>
    </Router>
  );
};

export default App;
